import { NavLink, Outlet } from 'react-router-dom';

export default function AppBar() {
  return (
    <>
      <div>
        <NavLink to="counter">Counter</NavLink>
        <NavLink to="todos">Todos</NavLink>
      </div>

      <Outlet />
    </>
  );
}
